import React from 'react'

const MovieBox = ({list}) => {
    return (
        <div className="MovieBox">
            <div className="movieimagelist">
            <img src={`https://image.tmdb.org/t/p/w10/${list && list.poster_path }`} alt={`${list && list.title} Poster`} />
            </div>
        </div>


    )
}

export default MovieBox
